import React from "react";
import {connect} from "react-redux";

const HelloComponent = ({message}) =>
  <div>
    <h1>{message}</h1>
  </div>

const stateToPropertyMapper = (state) => ({
  message: state.msg
})
export default connect
(stateToPropertyMapper)
(HelloComponent)
